import React, { useState } from 'react';
import { Route, Routes } from 'react-router-dom';
import './App.css';
import LoginPage from './pages/LoginPage';
import Layout from './components/Layout';
import BookingPage from './pages/BookingPage';
import AdminPage from './pages/AdminPage';// Importera din nya sida
import { Activity } from './types/Activity';
import PageBanner from './components/PageBanner';
import { UserRole } from './types/User';


function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [loggedInUser, setLoggedInUser]= useState({username:"",role:"",activities:[] as Activity[],password:""})

  function handleLogin(username:string,role:UserRole,activities:Activity[],password:string){
    setIsLoggedIn(true)
    console.log("in app")
    setLoggedInUser({ username, role, activities, password });
  }

  return (
    <div className="App">
      <Routes>
        <Route path='/' element={<Layout/>}>
          <Route index element={<LoginPage onLogin={handleLogin} />} />
          <Route element={<BookingPage/>}/>
          <Route path='/admin' element={<AdminPage />} /> 

        </Route>
      </Routes>
    </div>
  );
}

export default App;
